import { Button, Stack } from "@mui/material";
import {Link} from "react-router-dom";
import React from "react";

const Home = () => {
    return(
    <div>
    <Stack sx={{ml: -1, mr: -1}} paddingTop='75px' textAlign='center' color={"text.primary"} bgcolor={"background.default"}>
        <h1>Welcome</h1>
        <p>This Website is a place to upload recipes, view other people's recipes, get feedback on recipes, and keep track of your fridge and pantry.</p>
        <Stack sx={{margin: "10px auto"}} textAlign='center' direction="row" spacing={5}>
            <Button variant="contained">
                <Link style={{textDecoration: "none", color:"white"}} to={`/signin`}>
                    Sign In
                </Link>
            </Button>
            <Button variant="contained">
                <Link style={{textDecoration: "none", color:"white"}} to={`/register`}>
                    Register
                </Link>
            </Button>
        </Stack>
    </Stack>

    </div>
    );
}

export default Home;
